"use strict";(self.webpackChunkquant_docs=self.webpackChunkquant_docs||[]).push([[4248],{8559:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"/2020/09/28/welcome","metadata":{"permalink":"/ConquerIO/blog/2020/09/28/welcome","source":"@site/blog/2020-09-28-welcome.md","title":"Quant is live!","description":"It\'s launch time! \ud83d\ude80 \ud83c\udf89","date":"2020-09-28T00:00:00.000Z","formattedDate":"September 28, 2020","tags":[{"label":"hello","permalink":"/ConquerIO/blog/tags/hello"}],"readingTime":0.7,"hasTruncateMarker":false,"authors":[{"name":"Stuart Rowlands","title":"Founder @ QuantCDN","url":"https://www.twitter.com/stuart_rowlands","imageURL":"https://avatars0.githubusercontent.com/u/1256274?s=400&v=4"}],"frontMatter":{"id":"welcome","title":"Quant is live!","author":"Stuart Rowlands","author_title":"Founder @ QuantCDN","author_url":"https://www.twitter.com/stuart_rowlands","author_image_url":"https://avatars0.githubusercontent.com/u/1256274?s=400&v=4","tags":["hello"]}},"content":"It\'s launch time! \ud83d\ude80 \ud83c\udf89\\n\\nAfter a long time conceptualising, developing, testing, and confirming our assumptions with some of the biggest sites on the web we are ready for action.\\n\\nWe are huge advocates of the static web, and all it represents. Serving efficiency, speed, security, simplicity. QuantCDN was born from a desire to make things even better. By **lowering the barrier** and providing turnkey solutions we put the static web in reach of even more people. By providing **rich APIs** we continue to allow developers to continue to do what they do best.\\n\\nQuantCDN is a modern, global edge CDN backed on reliable and proven cloud-agnostic infrastructure. Read more about the features of the [Quant static edge platform](https://www.quantcdn.io/features).\\n\\nThis blog will serve as a central place to share release notes, upcoming features and musings on the static web movement."}]}')}}]);